Marley is een gele labrador die door John Grogan, een columnist voor een krant, en zijn vrouw Jennifer wordt geadopteerd. Het 
idee was om zo een idee te krijgen wat ouderschap inhoudt, maar de hond blijkt nogal hyperactief te zijn. Hij vernielt de boel, 
wordt van de gehoorzaamheidsschool geschopt en wordt alleen maar erger wanneer John en Jennifer kinderen krijgen.
